import React from 'react';
import { Link } from 'react-router-dom';
import $ from 'jquery';

const Sidebar = () => {
    return (
        <div className="app-sidebar">
          <Link to="" className="app-sidebar-link active" onClick={(e)=>{
              $(".app-sidebar-link").removeClass('active')
              e.target.classList.add('active')
          }} >
            Dashboard
          </Link>
          <Link to="" className="app-sidebar-link" onClick={(e)=>{
              $(".app-sidebar-link").removeClass('active')
              e.target.classList.add('active')
          }} >
            Commandes
          </Link>
          <Link to="" className="app-sidebar-link" onClick={(e)=>{
              $(".app-sidebar-link").removeClass('active')
              e.target.classList.add('active')
          }} >
            Messages
          </Link>
          <Link to="" className="app-sidebar-link" onClick={(e)=>{
              $(".app-sidebar-link").removeClass('active')
              e.target.classList.add('active')
          }} >
            Produits
          </Link>
        </div>
    );
}

export default Sidebar;
